import React from 'react';

function Navbar() {
    return (
        <nav class="navbar navbar-light bg-light">
            <ul>
                <li><h1>Loop Fruits</h1></li>
                <li>Right or Wrong</li>
                <li>Score Stuff</li>
            </ul>
        </nav>
    );
};

export default Navbar;
